from typing import List


class Solution:
    def divisibilityArray(self, word: str, m: int) -> List[int]:
        # time limit exceed
        res = []
        num = ""

        for idx in range(len(word)):
            num += word[idx]
            digit = int(num)

            if not digit % m:
                res.append(1)
            else:
                res.append(0)

        return res

    def divisibilityArray(self, word: str, m: int) -> List[int]:
        # time limit exceed
        res = []
        digit = int(word)

        while digit:
            if not digit % m:
                res.append(1)
            else:
                res.append(0)

            digit //= 10

        return res[::-1]

    def divisibilityArray(self, word: str, m: int) -> List[int]:
        # time limit exceed
        res = [0] * len(word)
        idx = len(word) - 1
        digit = int(word)

        while digit:
            if not digit % m:
                res[idx] = 1

            digit //= 10
            idx -= 1

        return res

    def divisibilityArray(self, word: str, m: int) -> List[int]:
        curr = 0
        res = []

        for c in word:
            curr = (curr * 10 + int(c)) % m
            res.append(int(curr == 0))

        return res


obj = Solution()
print(obj.divisibilityArray(word="998244353", m=3))
print(obj.divisibilityArray(word="1010", m=10))
